import "./App.css";
import Header from "./components/Header";
import Affairs from "./components/Affairs";
import React, { Component } from "react";


export default class App extends Component {
  render() {
    return (
      <div>
        <h1>
          <Header title="Список дел" />
        </h1>
        <main>
          <Affairs />
        </main>
        <aside></aside>
      </div>
    );
  }
}
